import itertools
from dataclasses import dataclass
import numpy as np

class GlobalConstants:
    max_rotation_per_turn: int = 18
    car_max_thrust: float = 100.


@dataclass
class DiscreteActionConverter:
    _actions: list[float] | None = None

    def __post_init__(self):
        self._actions = list(
            itertools.product(
                list(
                    range(
                        -GlobalConstants.max_rotation_per_turn,
                        GlobalConstants.max_rotation_per_turn + 1,
                    )
                ),
                [0, GlobalConstants.car_max_thrust],
            )
        )

    def get_angle_and_thrust(self, action_index: int) -> list[float]:
        return [float(x) for x in self._actions[action_index]]


@dataclass
class CheckpointInfo:
    rel_dx: float
    rel_dy: float
    angle_sin: float
    angle_cos: float

    def __post_init__(self):
        self.rel_dx = np.clip(self.rel_dx, -1., 1.)
        self.rel_dy = np.clip(self.rel_dy, -1., 1.)
        self.angle_sin = np.clip(self.angle_sin, -1., 1.)
        self.angle_cos = np.clip(self.angle_cos, -1., 1.)


@dataclass
class PodInfo:
    rel_vx: float
    rel_vy: float


